import{_ as e,n as a,p as i,a0 as l}from"./framework-e30e40a0.js";const r={},o=l('<h1 id="novedades" tabindex="-1"><a class="header-anchor" href="#novedades" aria-hidden="true">#</a> Novedades</h1><h2 id="julio-2022" tabindex="-1"><a class="header-anchor" href="#julio-2022" aria-hidden="true">#</a> julio 2022</h2><h3 id="krill" tabindex="-1"><a class="header-anchor" href="#krill" aria-hidden="true">#</a> Krill</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido la posibilidad de autenticar a través de cuentas de empresa de Google Suite</li><li>Se ha modificado la autencicación de la API/UI para que use JWT</li><li>Se ha mejorado la velocidad en las búsquedas en entornos con una gran cantidad de equipos monitorizados.</li><li>Se ha solucionado un error en nuestra PBX, que impedía que a los clientes que pulsaban una opción no contemplada por la centralita, fueran devueltos en el flujo al comienzo de la locución principal para poder escucharla de nuevo.</li></ul><h3 id="krill-monitoring-ui" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Corrección de diversos errores</strong>:</p><ul><li>Se ha corregido un problema que impedía la recuperación de los enlaces personalizados en la ficha de los equipos.</li><li>Se ha corregido el mensaje de error que aparecía al pulsarle en el botón <code>Reprovision</code> en la ficha de un equipo.</li><li>Se han corregido las respuestas de los CWMP Info que se realizan en la ficha de equipos.</li></ul><h3 id="krill-pbx-ui" tabindex="-1"><a class="header-anchor" href="#krill-pbx-ui" aria-hidden="true">#</a> Krill PBX UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha corregido un error que provocaba que los datos no se cargaran correctamente al cambiar de Realm (en entornos multi-realm).</li></ul><h3 id="krill-webservice-api" tabindex="-1"><a class="header-anchor" href="#krill-webservice-api" aria-hidden="true">#</a> Krill WebService (API)</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Se han corregido las reglas de validación de S/N para evitar valores nulos o no hexadecimales.</li><li>Se ha corregido la validación para evitar CLIs duplicados</li><li>La actualización de POTSes ya no devuelve los errores que aparecían en algunas ocasiones.</li></ul><h3 id="krill-core" tabindex="-1"><a class="header-anchor" href="#krill-core" aria-hidden="true">#</a> Krill Core</h3><p><strong>Algunas mejoras y correcciones</strong>:</p><ul><li>Se ha solucionado un error que impedía que los recursos de determinados servicios reportaran estados de <code>warning</code> o <code>critical</code>.</li></ul><h3 id="krill-gpon" tabindex="-1"><a class="header-anchor" href="#krill-gpon" aria-hidden="true">#</a> Krill GPON</h3><p><strong>Algunas correciones y mejoras</strong>:</p><ul><li>Se ha añadido la opción de marcar un equipo o una OLT entera para que no haga acciones de auto-provisión, re-provisión o des-provisión, para entornos configurados de forma manual y con parámetros especiales.</li><li>Se ha añadido Calix y FiberHome a la lista de OLTs que son capaces de provisionar mediante Krill.</li><li>Se ha homogeneizado la salida de los <code>cpe_info</code></li><li>Se ha corregido un error se que provocaba al realizar un <code>factory-reset</code> en ONUs de distinto fabricante al de la OLT donde estaban provisionados.</li><li>Se ha solucionado un error al tratar de obtener un <code>cpe_info</code> de un equipo cuando la OLT donde estaba provisionado no respondía a PING.</li></ul><h3 id="krill-docsis" tabindex="-1"><a class="header-anchor" href="#krill-docsis" aria-hidden="true">#</a> Krill DOCSIS</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido la capacidad de configurar <code>service-flows</code> usando nomenclatura FQDN sin tenerque usar direcciones IP.</li><li>Se ha mejorado la monitorización y graficación de las métricas de determinados CableModem.</li></ul><h3 id="krill-wimax" tabindex="-1"><a class="header-anchor" href="#krill-wimax" aria-hidden="true">#</a> Krill WiMAX</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha corregido un error que se provocaba al tratar de obtener información de los STAs de algunos APs.</li></ul><h2 id="mayo-2022" tabindex="-1"><a class="header-anchor" href="#mayo-2022" aria-hidden="true">#</a> mayo 2022</h2><h3 id="krill-1" tabindex="-1"><a class="header-anchor" href="#krill-1" aria-hidden="true">#</a> Krill</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha optimizado el tiempo de respuesta para bases de datos con gran volumen de equipos.</li></ul><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido la opción de filtrar los equipos por contact-groups (cómo lo hacía Krill 1).</li><li>Se han actualizado los tokens de búsqueda y añadidos nuevos para compatibilizar con el nuevo motor de bbdd IcingaDB.</li></ul><h3 id="krill-monitoring-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-1" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Corrección de diversos errores</strong>:</p><ul><li>Se ha corregido un fallo que impedía que se mostrara correctamente la barra de herramientas de la ficha de un equipo en vista móvil.</li><li>Se ha corregido el filtrado por host-name de la vista histórico de estados.</li></ul><h3 id="krill-oratio-ui" tabindex="-1"><a class="header-anchor" href="#krill-oratio-ui" aria-hidden="true">#</a> Krill Oratio UI</h3><p><strong>Corrección de errores menores</strong>:</p><ul><li>Se ha corregido el auto refresco de datos en la vista sesiones de radius.</li></ul><h3 id="krill-isp-ui" tabindex="-1"><a class="header-anchor" href="#krill-isp-ui" aria-hidden="true">#</a> Krill ISP UI</h3><p><strong>Nuevas características y correcciones</strong>:</p><ul><li>Se ha añadido un marcador al tratar de crear, actualizar o eliminar elementos para evitar errores de peticiones duplicadas.</li><li>Se ha añadido la funcionalidad de poder eliminar un Cliente</li><li>Se ha corregido un error que provocaba que los datos no se cargaran correctamente al cambiar de Realm (en entornos multi-realm).</li></ul><p><strong>Nuevas características</strong>:</p><ul><li>Se ha añadido la opción de poder buscar los hosts por su ID, independientemente de la longitud que éste tenga.</li><li>Se ha añadido una regla de validación para los CLI y los labels de los POTSes que impide que se escriban más de 16 carácteres.</li><li>Se ha añadido en el cuadro de diálogo de nuevo CPE, el ID y el external-ID en el listado de clientes para facilitar su búsqueda.</li></ul><p><strong>Algunas correcciones</strong>:</p><ul><li>Se ha corregido un problema que impedía que se visualizaran correctamente las banderas de los idiomas seleccionados en los POTSes.</li></ul><h3 id="krill-pbx-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-pbx-ui-1" aria-hidden="true">#</a> Krill PBX UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido en el cuadro de diálogo de nuevo CPE, el ID y el external-ID en el listado de clientes para facilitar su búsqueda.</li></ul><h2 id="abril-2022" tabindex="-1"><a class="header-anchor" href="#abril-2022" aria-hidden="true">#</a> abril 2022</h2><h3 id="krill-2" tabindex="-1"><a class="header-anchor" href="#krill-2" aria-hidden="true">#</a> Krill</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido información de registro a los dispositivos WiMAX</li><li>Se ha incluído la monitorización de dispositivos de tipo Relay de la marca Tycon.</li><li>Se ha añadido la monitorización de EDFAs.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>Se ha corregido un error en algunas gráficas de tipo ITFS que no se mostraban correctamente.</li><li>Monitorización de los servicios <code>voice</code> de los equipos con telefonía.</li><li>Monitorización del BGP Peers, que en ocasiones mostraba un error al ejecutarse el check.</li></ul><h3 id="krill-monitoring-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-2" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nuevas mejoras</strong>:</p><ul><li>Se ha añadido un nuevo icono identificativo para los equipos de tipo Relay en la ficha de hosts.</li><li>Se ha modificado el filtro de <code>Sin localización</code> de la vista SmartTree.</li><li>Se ha añadido una barra de herramientas con la paginación en la parte inferior de todas las vistas que tengan tablas de datos.</li></ul><p><strong>Corrección de diversos errores</strong>:</p><ul><li>Se ha corregido el enlace al visor de CDRS desde la ficha de CPEs.</li><li>La vista de diagnósticos de los CPEs deshabilitará aquellos que no sean compatibles con el modelo de éste para evitar que se puedan ejecutar.</li><li>Los logs que se veían en el timeline de los equipos a veces no se mostraban correctamente cuando había eventos sobre éste.</li></ul><h3 id="krill-rubik-ui" tabindex="-1"><a class="header-anchor" href="#krill-rubik-ui" aria-hidden="true">#</a> Krill Rubik UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido una barra de herramientas con la paginación en la parte inferior de todas las vistas que tengan tablas de datos.</li></ul><h3 id="krill-isp-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-isp-ui-1" aria-hidden="true">#</a> Krill ISP UI</h3><p><strong>Nuevas características</strong>:</p><ul><li>Se ha añadido una regla de validación para evitar duplicidad de CLIs en el listado de POTSes de un CPE.</li><li>Se ha añadido la opción de crear un cliente desde la pantalla de creación de un CPE así como un selector de perfil de velocidad.</li></ul><p><strong>Algunas correcciones</strong>:</p><ul><li>Se ha corregido la regla de validación relativa a la MAC para crear o modificar CPEs.</li><li>Se ha corregido el enlace a la ficha del CPE desde la vista de edición de CPEs.</li></ul><h3 id="krill-installer-ui" tabindex="-1"><a class="header-anchor" href="#krill-installer-ui" aria-hidden="true">#</a> Krill Installer UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha corregido el enlace a la ficha del CPE desde el listado de seguimiento de instalación.</li></ul><h3 id="krill-acs" tabindex="-1"><a class="header-anchor" href="#krill-acs" aria-hidden="true">#</a> Krill ACS</h3><p><strong>Algunas correciones</strong>:</p><ul><li>Se ha corregido un error que provocaba errores al solicicitar información CWMP en CPEs Mikrotik.</li></ul><h3 id="krill-docsis-1" tabindex="-1"><a class="header-anchor" href="#krill-docsis-1" aria-hidden="true">#</a> Krill DOCSIS</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Ahora las plantillas de flujo de servicios usan FQDN en vez de la dirección IP.</li></ul><h2 id="marzo-2022" tabindex="-1"><a class="header-anchor" href="#marzo-2022" aria-hidden="true">#</a> marzo 2022</h2><h3 id="krill-3" tabindex="-1"><a class="header-anchor" href="#krill-3" aria-hidden="true">#</a> Krill</h3><p><strong>Algunas correciones y mejoras</strong>:</p><ul><li>Se ha añadido la información del servicio <code>backup</code> a los PTPs.</li><li>Se ha corregido un error que provocaba discrepancias entre el business-impact de los host/servicios y su <code>display_name</code>.</li><li>Se han corregido diversos errores menores en varios checks y sistemas de monitorización.</li><li>Se han actualizado los checks de oratio (para el servicio de Radius) y asterisk (para los servicios de Voice).</li></ul><h3 id="krill-ui" tabindex="-1"><a class="header-anchor" href="#krill-ui" aria-hidden="true">#</a> Krill UI</h3><p><strong>Nuevas características</strong>:</p><ul><li>El cuadro de diálogo de cambios de versión, se abre de forma automática para mostrar las novedades, siempre que se detecta una nueva versión de la aplicación.</li></ul><h3 id="krill-monitoring-ui-3" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-3" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nuevas mejoras</strong>:</p><ul><li>Se han añadido las columnas DnBw y UpBw en la vista matrix</li><li>Las gráficas de ancho de banda de Interface muestran una línea en el valor 0 para separar el tráfico de subida y bajada.</li><li>En el timeline de un Host ahora solo se puede realizar Zoom si se habilita la opción que se ha añadido en su barra de opciones.</li><li>La barra de opciones principal de un Host, ahora se queda fija en la parte superior cuando se hace scroll sobre la ficha.</li><li>Los hosts muestran las IPs obtenidas a traves de CWMP en la ficha.</li><li>El timeline de los hosts ahora muestra los eventos de provisión de tipo GPON.</li><li>La tabla de la vista matrix se ha adaptado mejor a pantalla completa.</li><li>Las títulos de las cajas de cada host-group dentro de su vista, ahora te llevan a la búsqueda de equipos de ese tipo.</li><li>Se han añadido las IPs de los CPEs obtenidas vía CWMP a la lista de la ficha monitor de un CPE</li></ul><p><strong>Corrección de diversos errores</strong>:</p><ul><li>Apertura de un cuadro de diálogo informativo al mover el rango de fechas del timeline de un Host.</li><li>Las IPs provenientes de CWMP en ocasiones no se mostraban correctamente en la ficha del Host.</li><li>Los valores <code>ups</code>, <code>nas</code>, <code>subnet</code>, <code>device</code> e <code>icmp</code> del filtro de búsqueda <code>host-group</code>.</li><li>Los enlaces para mostrar todos los elementos de los Widgets de problemas de host y servicios, histórico y notificaciones.</li><li>El color del estado <code>down</code> dentro de la vista histórico de la ficha de los equipos.</li><li>Se ha corregido la visualización de: <ul><li>Datos administrativos de un CPE (nombre del cliente)</li><li>Modelo y marca del Host</li></ul></li></ul><h3 id="krill-oratio-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-oratio-ui-1" aria-hidden="true">#</a> Krill Oratio UI</h3><p><strong>Corrección de errores menores</strong>:</p><ul><li>Se ha añadido una etiqueta a los botones de IPs y Sesiones duplicadas en la lista de sesiones activas de Oratio.</li></ul><h3 id="krill-isp-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-isp-ui-2" aria-hidden="true">#</a> Krill ISP UI</h3><p><strong>Nuevas características</strong>:</p><ul><li>Se ha desactivado la actualización automática de POTS de los CPE y se ha habilitado un botón para guardar los cambios detectados.</li><li>Se ha añadido el nombre completo de los clientes en el listado de CPEs.</li><li>Se ha añadido un desplegable para mostrar/ocultar columnas en el listado de CPEs.</li><li>Los distintos perfiles muestran valores para &quot;humanos&quot; en el listado de CPEs.</li><li>La regla de validación de serial numbers para equipos de GPON ahora depende de una variable de inventario.</li><li>Se ha añadido el nuevo módulo ISP que permite la creación, modificación y eliminación de: <ul><li>CPE Profiles</li><li>Clientes</li><li>CPEs</li><li>Contextos de PBX</li></ul></li></ul><h3 id="krill-isp-cli" tabindex="-1"><a class="header-anchor" href="#krill-isp-cli" aria-hidden="true">#</a> Krill ISP-Cli</h3><p><strong>Nuevas características</strong>:</p><ul><li>Se ha añadido la opción de lanzar una recarga de OLTs, pones y CPEs con el comando <code>snapshot</code> desde <code>ispcli</code>.</li></ul><h3 id="kiwi" tabindex="-1"><a class="header-anchor" href="#kiwi" aria-hidden="true">#</a> Kiwi</h3><p><strong>Algunas correcciones</strong>:</p><ul><li><p>Se ha corregido el formato de salida de la api para</p><ul><li><code>/api/v2/monitoring/hostgroups</code></li><li><code>/api/v2/monitoring/location/summary</code></li></ul></li><li><p>Se ha eliminado la opción de crear y eliminación de POTS vía API, ya que éstos se generan automáticamente al crear un CPE con puertos de telefonía.</p></li></ul><h3 id="krill-webservice-api-1" tabindex="-1"><a class="header-anchor" href="#krill-webservice-api-1" aria-hidden="true">#</a> Krill WebService (API)</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Se ha corregido un error que podía provocar que se macharan los POTS de un usuario si éste tenía más de una PBXv.</li></ul><h3 id="krill-core-1" tabindex="-1"><a class="header-anchor" href="#krill-core-1" aria-hidden="true">#</a> Krill Core</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha añadido la monitorización de los servicios de <code>radio</code> y <code>setup</code> para los PTPs Mimosa.</li><li>Se ha añadido la monitorización de los Peers BGP de los routers</li><li>Se ha eliminado la limitación de velocidad a nivel de NAS cuando se ha establecido en la propia OLT.</li></ul><h3 id="krill-gpon-1" tabindex="-1"><a class="header-anchor" href="#krill-gpon-1" aria-hidden="true">#</a> Krill GPON</h3><p><strong>Algunas correciones y mejoras</strong>:</p><ul><li>Se ha mejorado la graficación en tiempo real del ancho de banda de los CPEs.</li><li>Se ha corregido un error que afectaba a clientes sin CaTV haciendo que el servicio TxRx apareciera en estado desconocido.</li><li>En ocasiones se sobreescribieran los mementos con datos antiguos.</li><li>Las discrepancias entre los datos del memento y la realidad en los service-ports podían provocar que el patcher fallara.</li><li>Algunos errores en las gráficas de ancho de banda de los CPEs</li><li>El mensaje de error cuando un provisionador no puede borrar una ONU (en Huawei).</li></ul><h3 id="krill-wimax-1" tabindex="-1"><a class="header-anchor" href="#krill-wimax-1" aria-hidden="true">#</a> Krill WiMAX</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Se ha corregido un error del check de los servicios <code>downstream</code> y <code>upstream</code> referente al cálculo de los valores de las métricas <code>dnairtime</code> y <code>upairtime</code>.</li></ul><h2 id="febrero-2022" tabindex="-1"><a class="header-anchor" href="#febrero-2022" aria-hidden="true">#</a> febrero 2022</h2><h3 id="krill-4" tabindex="-1"><a class="header-anchor" href="#krill-4" aria-hidden="true">#</a> Krill</h3><ul><li>Se han corregido diversos errores menores en varios checks y sistemas de monitorización.</li><li>Corregido un error en el sumario de localizaciones que podía provocar inconsistencia de datos con respecto a la búsqueda de problemas.</li><li>Corregido el formato de salida del estado de los hostgroups para compatibilizarlo con el nuevo modelo de datos.</li></ul><h3 id="krill-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-ui-1" aria-hidden="true">#</a> Krill UI</h3><p><strong>Nuevas características y correccion de errores menores</strong>:</p><ul><li>Se ha añadido un resumen de cambios del último mes en la pantalla de cambios de versión.</li><li>Se ha corregido un error que provocaba que en ocasiones al cambiar de pestaña de dashboard no se cargara correctamente la configuración de algunos widgets.</li></ul><h3 id="krill-monitoring-ui-4" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-4" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nuevas características y correccion de errores menores</strong>:</p><ul><li>En la vista Sonar, se ha añadido un panel informativo con los estados de hosts y servicios, así como la ubicación geográfica de los mismos.</li><li>Se ha corregido el orden de localizaciones por número de problemas en la vista Sonar.</li><li>Se ha corregido la información del cliente en la ficha de los CPEs.</li><li>Se han añadido a la vista WorldMap equipos que contienen problemas de servicios.</li><li>Se ha establecido una búsqueda por defecto en las vistas de world-map y smart-tree: <code>hostgroup:core business_impact:&amp;gt;=2</code>.</li><li>Al acceder a la vista sonar, se borra la búsqueda general</li><li>Se ha añadido el histórico de cambios de estado en el timeline de los equipos tanto para el host como sus servicios.</li><li>Se ha añadido un panel con información relevante a la localización pulsada de la vista sonar, con detalle de equipos/servicios con problemas.</li><li>Se han añadido marcadores en el mini-mapa del panel informativo de la vista sonar para aquellos equipos con problemas propios o de sus servicios.</li><li>Se ha corregido un error que provocaba que los cambios realizados en la configuración de los widgets de típo gráfica no se guardaran correctamente.</li><li>Se ha corregido un error en el filtro de <code>duration</code> (duración desde el último cambio de estado) en el cuadro de búsqueda.</li><li>Se ha corregido una incoherencia de colores respecto a los estados en el panel informativo de las localizaciones de la vista Sonar.</li></ul><h3 id="krill-oratio-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-oratio-ui-2" aria-hidden="true">#</a> Krill Oratio UI</h3><p><strong>Corrección de errores menores</strong>:</p><ul><li>Se ha añadido un mensaje explicativo en el Widget de IP Pools en caso de que no haya Pools disponibles en la red.</li></ul><h3 id="kiwi-1" tabindex="-1"><a class="header-anchor" href="#kiwi-1" aria-hidden="true">#</a> Kiwi</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Se ha añadido la opción de poder editar el Serial Number de un CPE GPON, si éste no existe.</li><li>Se ha corregido un error que podía provocar que no se cargara correctamente el panel de administración.</li></ul><h3 id="krill-core-2" tabindex="-1"><a class="header-anchor" href="#krill-core-2" aria-hidden="true">#</a> Krill Core</h3><p><strong>Algunas correciones de errores</strong>:</p><ul><li>Se han corregido diversos checks relativos al core.</li><li>Se ha corregido un error del check de generación de backup de Mikrotik que podía provocar un error al crear el backup.</li><li>Solucionada falsa alarma por caída de tráfico en Mikrotik</li></ul><h3 id="kraken-kitchen" tabindex="-1"><a class="header-anchor" href="#kraken-kitchen" aria-hidden="true">#</a> Kraken Kitchen</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Corregido error que hacía que no se modificara la configuración del DHCP al cambiar el <code>remote_id</code> de un CPE.</li></ul><h3 id="kraken-radius-accounting" tabindex="-1"><a class="header-anchor" href="#kraken-radius-accounting" aria-hidden="true">#</a> Kraken Radius Accounting</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Se ha corregido un error que hacía desaparecer información de accountings en la ficha de los equipos.</li></ul><h2 id="enero-2022" tabindex="-1"><a class="header-anchor" href="#enero-2022" aria-hidden="true">#</a> enero 2022</h2><h3 id="krill-5" tabindex="-1"><a class="header-anchor" href="#krill-5" aria-hidden="true">#</a> Krill</h3><ul><li>Se han corregido diversos errores menores en varios checks y sistemas de monitorización.</li><li>Check del Mikrotik que obtiene su versión del OS.</li><li>Relación de dependencia entre los CPEs y sus hosts de registro</li><li>Refactorización de los datos administrativos almacenados en el sistema de monitorización.</li><li>BackUp de configuración de los APs Ubiquiti.</li><li>Monitorización de los Peers BGP para Netengine Huawei.</li><li>Se ha solucionado el acceso a los enlaces de los equipos vía proxy.</li><li>BackUps APs.</li><li>Monitorización de ITFS en los PTPs.</li><li>Polling de CPEs para las diveras tecnologías (GPON, WiMax, etc)</li><li>Monitorización de HostAlive solo en redes con <code>monitor=false</code>.</li><li>Ampliación de la frecuencia de chequeo del APT a 1 día.</li><li>Añadido percentil 95 para las métricas de ancho de banda de los ITFS.</li><li>Kraken-Kitchen.</li><li>Backup de Mikrotik.</li><li>Radius Accounting.</li><li>SIP Peers (Asterisk).</li><li>Asterisk DDIs conf.</li><li>Se ha añadido la monitorización por ICMP de los NAS que no forman parte de Core.</li></ul><h3 id="krill-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-ui-2" aria-hidden="true">#</a> Krill UI</h3><p><strong>Nueva ventana de changelog</strong>:</p><ul><li>Nueva ventana de changelog, accesible desde el número de versión de la barra de herramientas inferior, con información detallada de todos los módulos. (Actualmente 3 últimos meses).</li></ul><p><strong>Optimizaciones de código</strong>:</p><ul><li>Refactorización de los atributos de configuración persistentes de cada usuario.</li></ul><h3 id="krill-monitoring-ui-5" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-5" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nueva característica</strong>:</p><ul><li>Añadida una columna con el tiempo desde el último cambio a la vista Matrix.</li><li>Se refactorizó la configuración del usuario para la implementación de una API que la guarda y recupera.</li><li>Añadidos nuevos iconos a IPTV y CATV en la vista Host.</li><li>Adaptado los nuevos atributos de cpes.</li><li>Nueva traducción para flapping.</li><li>Arreglada superposición de la barra de mensajes de conversaciones.</li><li>Lista de IP en la vista del monitor host, ahora detecta la URL de los enlaces del Host.</li><li>Se agregaron enlaces de Host en el menú de acciones de la parte superior derecha de la vista de Host.</li><li>Se agregaron direcciones IP PPPoE a la vista de la pestaña Host Monitor.</li><li>Fecha de expiración agregada en la vista de <code>/all</code> los hosts.</li></ul><p><strong>Optimizaciones de código</strong>:</p><ul><li>Se ha corregido el selector de servicios del host en la vista movil.</li><li>Se ha añadido un indicador de carga en la vista de Host-groups</li><li>Solucionado el enlace de la información de registro en la vista del host.</li><li>Arreglado un error en la vista Host que afectaba a la información administrativa de un host.</li><li>Se ha optimizado la generación de enlaces de los equipos en base a su marca, modelo y especificaciones de la red.</li><li>Se eliminó el enlace a la vista de radius en el menu del módulo <code>monitoring</code>. La vista ahora depende del módulo de la aplicación <code>oratio</code>.</li><li>Corregido el error que mantenía el cuadro de diálogo de confirmación de la acción visible después de presionar el botón <code>Sí, estoy seguro</code> en la vista de la pestaña del monitor del host.</li><li>El cuadro de diálogo en la vista host monitor, ahora se cierra cuando finaliza la acción.</li><li>Se corrigió cuando cualquier padre o formato no válido para los padres está presente.</li></ul><h3 id="krill-oratio-ui-3" tabindex="-1"><a class="header-anchor" href="#krill-oratio-ui-3" aria-hidden="true">#</a> Krill Oratio UI</h3><p><strong>Nuevo complemento para el panel de control</strong>:</p><ul><li>Se ha añadido un mensaje de alerta cuando no existen POOLs de IPs.</li></ul><h3 id="kiwi-2" tabindex="-1"><a class="header-anchor" href="#kiwi-2" aria-hidden="true">#</a> Kiwi</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Auto inserción de equipos en la parte de monitorización desde el ISP.</li></ul><h3 id="krill-acs-1" tabindex="-1"><a class="header-anchor" href="#krill-acs-1" aria-hidden="true">#</a> Krill ACS</h3><p><strong>Algunas correciones</strong>:</p><ul><li>Comportamiento de las sesiones de reporte TR069.</li><li>Diagnósticos de equipos por TR069.</li><li>CPE/tecnología falla cuando kiwi es diferente de krill.</li></ul><h3 id="krill-gpon-2" tabindex="-1"><a class="header-anchor" href="#krill-gpon-2" aria-hidden="true">#</a> Krill GPON</h3><p><strong>Algunas correciones y mejoras</strong>:</p><ul><li>Ahora la provisión permite como filtro una OLT</li><li>Nuevas notificaciones por pérdida óptica de uno o más clientes configurable mediante umbrales</li><li>Validación de alarmas de PON por pérdida de ONUs.</li><li>Monitorización de RX para determinadas tarjetas.</li></ul><h2 id="diciembre-2021" tabindex="-1"><a class="header-anchor" href="#diciembre-2021" aria-hidden="true">#</a> diciembre 2021</h2><h3 id="krill-ui-3" tabindex="-1"><a class="header-anchor" href="#krill-ui-3" aria-hidden="true">#</a> Krill UI</h3><p><strong>Nuevas características</strong>:</p><ul><li>Posibilidad de copiar / mover widgets entre Dashboards, a través de las opciones del modo edición de Dashboards.</li><li>Panel de control adaptado a modo responsivo.</li><li>Ahora el usuario puede personalizar su dashboard.</li><li>Modo responsive a los cuadros de diálogos de los widgets.</li><li>Ahora al hacer clic en el icono de phicus o en KrillUI es renderizado al tablero.</li><li>Los widgets disponibles en el tablero ahora verifican su atributo múltiple y existencia en el tablero actual.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>Correción en los marcadores y en el historial de busqueda</li><li>Correción de algunos fallos en las funciones del historial de búsqueda.</li><li>Correción de algunos fallos en las funciones del historial de búsqueda.</li><li>Se cambiaron las referencias de Trivial a Smart Tree.</li><li>Corregida la traducción del título del widget de bienvenida</li></ul><h3 id="krill-monitoring-ui-6" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-6" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nuevas características</strong>:</p><ul><li>Nuevo widget para mostrar métricas de cualquier host/servicio</li><li>Añadido número de host/servicios caídos o críticos con business-impact &gt;= 2 en el menú lateral.</li><li>Añadida la fecha de expiración de CPEs en la vista <code>/monitoring/all</code>.</li><li>Añadidas las IPs vigentes de radius/PPPoE en el bloque de IPs de la ficha de un CPE.</li><li>Check_command oculto para usuarios diferentes a phicusadmin</li><li>En el menú de la barra lateral ahora se muestra una insígnia con el número total crítico de hosts y servicios.</li><li>Se agregó un nuevo widget para gráficos.</li><li>Añadida información de ubicación a la vista matrix.</li><li>Ahora se muestran eventos de de desconexión de radius host en la línea de tiempo de la vista Host Monitor.</li><li>Marcado como ack/downtime de la lista de hosts en la ubicación o host seleccionado en la vista de Smart Tree.</li><li>Etiquetas en gráficos en tiempo real de ancho de banda y Tx/Rx en la pestaña Host Monitor.</li><li>Se agregó más funcionalidad para expandir los gráficos en la vista de la pestaña Host y Servicios.</li><li>Se agregaron algunas traducciones al último widget de notificaciones.</li><li>Añadido menu de atajos en la vista de inicio de monitorin</li><li>Añadidas algunas traducciones a los widgets.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>Cambiados algunos menús de la barra lateral.</li><li>Refactorización de alguna traducción en el panel de monitoring</li><li>Se modificó el ícono para el host de tipo Nas.</li><li>Al hacer doble clic en el host, ahora se abre la URL correcta en una nueva ventana.</li><li>Se cambió el color de los estados inalcanzables en la vista sonar.</li><li>Se corrigieron problemas gráficos menores en la vista SmartTree</li><li>Algunas traducciones corregidas en la vista Smart Tree.</li><li>Se cambió la ruta base para cada ruta establecida en /monitoring y se cambió Trivial a Smart Tree.</li><li>Refactorización del comportamiento del gráfico de expansión en la vista de la pestaña Gráficos de host y servicios.</li><li>Altura mínima establecida para la lista de servicios en la vista de servicios de host.</li><li>Corrección de la altura mínima para los gráficos en el widget de resumen.</li><li>Algunas lineas de código eliminadas.</li><li>Refactorización del código de los widgets.</li><li>Mejorada la vista all en modo móvil.</li><li>Refactorización de código de las barras de herramientas.</li><li>Habilitado el botón de cerrar cuando el cuadro de diálogo del estado de un Pon carga datos.</li><li>Los botones Pon Status en la pestaña de servicio del host aparecen y desaparecen en cada actualización.</li><li>Botón de pestaña de servicio deshabilitado cuando no hay servicios disponibles en la Vista de host.</li><li>En la vista de grupo de hosts, se eliminó todo el resumen de hosts para aumentar la velocidad de carga.</li><li>Ahora están todos los elementos en vista Matrix.</li><li>Añadidas traducciones al widget de últimas notificaciones</li><li>Corregido el que siempre se agregue la opción para programar el tiempo de inactividad de los hosts y los servicios aunque estén en buen estado.</li><li>Se corrigió el cuadro de diálogo de estado del cierre de un Pon al hacer clic en su CPE.</li></ul><h3 id="krill-oratio-ui-4" tabindex="-1"><a class="header-anchor" href="#krill-oratio-ui-4" aria-hidden="true">#</a> Krill Oratio UI</h3><p><strong>Nuevo complemento para el panel de control</strong>:</p><ul><li>Nuevo widget para mostrar el porcentaje de IPs libres/usadas de cualquier Pool seleccionado.</li><li>Mejorado en modo responsivo las tablas de datos.</li></ul><h3 id="krill-rubik-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-rubik-ui-1" aria-hidden="true">#</a> Krill Rubik UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Añadido modo responsivo a las barras de herramientas en algunas vistas.</li><li>Mejorado el modo responsive en las tablas de datos.</li><li>Añadido un deslizador a la vista Inicio.</li></ul><h3 id="krill-isp-ui-3" tabindex="-1"><a class="header-anchor" href="#krill-isp-ui-3" aria-hidden="true">#</a> Krill ISP UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Mejorado el modo responsive en las tablas de datos.</li></ul><h3 id="krill-pbx-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-pbx-ui-2" aria-hidden="true">#</a> Krill PBX UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Mejorado el modo responsive en las tablas de datos.</li></ul><h3 id="krill-installer-ui-1" tabindex="-1"><a class="header-anchor" href="#krill-installer-ui-1" aria-hidden="true">#</a> Krill Installer UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>En la Lista de CPE cuando no hay un perfil de CPE disponible, ahora esta información no se muestra.</li></ul><h3 id="krill-webservice-api-2" tabindex="-1"><a class="header-anchor" href="#krill-webservice-api-2" aria-hidden="true">#</a> Krill WebService (API)</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>Corregida la acción de reinicio desde la ficha de Shinken</li><li>Los cambios en las PBX no lanzaban el playbook del asterik</li><li>No se permitía dejar vacío el campo address_profile, ahora si</li></ul><h2 id="noviembre-2021" tabindex="-1"><a class="header-anchor" href="#noviembre-2021" aria-hidden="true">#</a> noviembre 2021</h2><h3 id="krill-ui-4" tabindex="-1"><a class="header-anchor" href="#krill-ui-4" aria-hidden="true">#</a> Krill UI</h3><p><strong>Algunas mejoras y correcciones</strong>:</p><ul><li>Opción agregada para eliminar el tablero Capacidad de múltiples tableros y widgets para la vista de inicio principal de krill-ui.</li><li>Se corrigió la creación, edición y eliminación de marcadores del usuario del buscador porque no se mostraban hasta la actualización.</li><li>Se corrigieron algunos errores en la edición de marcadores de usuarios.</li><li>Eliminados los tooltip en el modo responsivo.</li></ul><h3 id="krill-monitoring-ui-7" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-7" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Nueva característica</strong>:</p><ul><li>Se agregó la utilidad de expandir y contraer la lista de servicios en la vista servicios del host.</li><li>Desplazamiento automático al servicio seleccionado en la vista de servicio del host.</li><li>Añadidos algunos nuevos iconos para tipos de host en la vista de Host.</li><li>En la vista Sonar, ahora solo muestra localizaciones con host</li><li>En la vista Host Monitor, ahora se muestra en la línea de tiempo problemas del servicio TR069</li><li>Añadido Tooltip para los long-output en la linea de tiempo de host y servicio</li></ul><p><strong>Algunas mejoras</strong>:</p><ul><li>Carga de velocidad mejorada en la vista Trivial.</li><li>Carga de velocidad mejorada en la vista Sonar.</li><li>La información de CWMP en la vista de la pestañana Tecnología de host, ahora se carga al inicio.</li><li>Se modificó el botón de cambio de tamaño en la vista de sonar</li><li>Refactorización y mejora de código.</li><li>Se corrigió el cambio automático y repentino del servicio actual y de pestaña en la vista de servicios del host.</li><li>Se corrigió el prefijo de IP de Huawei y Ubiquiti cuando el modelo no estaba disponible en la vista de Host Monitor.</li><li>Pie de página de las gráficas, mejorado en la vista de pestaña Host Graph.</li><li>Ahora descontamos los problemas de reconocimiento y tiempo de inactividad de los malos estados totales y, si todos son manejados,la ubicación está bien.</li><li>Valores de rango de datos predeterminados establecidos para el día actual (de 0:00:00 a 23:59:59).</li><li>Refactorización y mejora de código.</li></ul><p><strong>Algunas mejoras y arreglos</strong>:</p><ul><li>Se agregó información de intentos máximos a la vista Información del servicio del host.</li><li>Corrección del filtro de gráficas para la pestaña de gráficas de servicio.</li><li>Se corrigieron las etiquetas de estado en la vista del historial de la pestaña del servicio del host y se agregó la casilla de verificación Mostrar notificaciones.</li></ul><p><strong>Algunos arreglos</strong>:</p><ul><li>Devuelta la capacidad de búsqueda del navegador a la vista Smart Tree, manteniendo siempre el grupo de host: núcleo y tipo: host.</li><li>Se agregaron IPs de Radius a la vista monitor del host.</li><li>Se agregó bp:&gt;2 a la búsqueda predeterminada de la vista Smart Tree.</li><li>Mostrar el tiempo de actividad del servicio en la vista de la pestaña de información del servicio del host.</li><li>Filtro de CDR y enlace a CPE.</li><li>Arreglar la búsqueda de World Map para agregar &#39;type = Host&#39;</li><li>Expansión de gráfico en la vista Gráficos de servicio de host</li></ul><h3 id="krill-pbx-ui-3" tabindex="-1"><a class="header-anchor" href="#krill-pbx-ui-3" aria-hidden="true">#</a> Krill PBX UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Añadidas traducciones a la vista de Edición de PBX.</li><li>Añadidas traducciones.</li><li>Modo responsivo implementado.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>Arreglado para evitar CLIps duplicados en grupos y colas.</li><li>Corregidas algunas traducciones.</li><li>Corregido el filtro de fechas de CDRs.</li></ul><h3 id="krill-webservice-api-3" tabindex="-1"><a class="header-anchor" href="#krill-webservice-api-3" aria-hidden="true">#</a> Krill WebService (API)</h3><p><strong>Algunas correcciones</strong>:</p><ul><li>En los serializadores pbx, se creó un decoded jump serializador para swagger y se refactorizó el resultado de las opciones del recepcionista (agregada la propiedad decoded_jump en el modelo y eliminada to_representation.</li><li>Corregido el error 500 en post customer/pbx/ddi&amp;groups</li><li>No se asignaba el atributo pool cuando se genera un usuario PPPoE via API.</li></ul><h3 id="krill-acs-2" tabindex="-1"><a class="header-anchor" href="#krill-acs-2" aria-hidden="true">#</a> Krill ACS</h3><p><strong>Algunas correciones</strong>:</p><ul><li>Configurado celery para que descubra automaticamente tareas en kws y las comparta en Kiwi.</li></ul><h3 id="krill-core-3" tabindex="-1"><a class="header-anchor" href="#krill-core-3" aria-hidden="true">#</a> Krill Core</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Salida de comprobaciones mejorada cuando un lado remoto SAF/IntegraW no responde a SNMP.</li><li>Monitorización de placas FiberHome.</li><li>Reporte de flanco de bajada.</li></ul><h3 id="krill-gpon-3" tabindex="-1"><a class="header-anchor" href="#krill-gpon-3" aria-hidden="true">#</a> Krill GPON</h3><p><strong>Algunas correciones</strong>:</p><ul><li>Desajuste de memento cuando varios trabajadores comienzan a desaprovisionarse al mismo tiempo.</li><li>Configurado celery para que descubra automáticamente las tareas en kws y las comparta en kiwi.</li></ul><h2 id="octubre-2021" tabindex="-1"><a class="header-anchor" href="#octubre-2021" aria-hidden="true">#</a> octubre 2021</h2><h3 id="krill-ui-5" tabindex="-1"><a class="header-anchor" href="#krill-ui-5" aria-hidden="true">#</a> Krill UI</h3><p><strong>Algunos cambios</strong>:</p><ul><li>Se eliminó &#39;cadena:&#39; del buscador y en la URL de búsqueda</li><li>Rediseñado el buscador.</li></ul><h3 id="krill-monitoring-ui-8" tabindex="-1"><a class="header-anchor" href="#krill-monitoring-ui-8" aria-hidden="true">#</a> Krill Monitoring UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Añadidos segundos a las vistas de la línea de tiempo del historial de Host y Servicios.</li><li>Añadidos filtros en la vista Historial.</li><li>Agregada la fecha máxima al calendario en CDRS, CWMP, Historial, Eventos de Host, Gráficas de Host y Gráficas de Servicios de Host.</li><li>Matrix ahora mantiene columnas visibles si se cambian manualmente.</li><li>La vista del host ahora muestra el indicador de servicios reconocidos o inactivos en la línea de tiempo y el icono de la pestaña de servicio.</li><li>URL para el botón Host/Servicio en la vista /all</li><li>Añadida la nueva vista Eventos de Host</li><li>Algunos problemas gráficos en la vista All</li><li>Agregado el cuadro de diálogo PonStatus a la línea de tiempo de la vista monitor del host.</li><li>Agregado cuadro de diálogo PonStatus a la vista de servicio Pon</li><li>Añadida columna de topología a la tabla de datos Matrix en Matrix View.</li><li>Se agregaron sesiones PPPoE en la línea de tiempo de la vista monitor del host.</li><li>Eventos de la línea de tiempo, ahora contempla la fuente &#39;asterisk&#39;.</li><li>Eventos de compensación de zona horaria en la vista monitor del host.</li><li>Estado de registro agregado a la vista monitor del host.</li><li>Estado de registro agregado y datos administrativos a la vista Matrix.</li></ul><p><strong>Algunos arreglos</strong>:</p><ul><li>Filtro de impacto empresarial en la vista de historial y en el menú de la barra lateral de descripción general.</li><li>Se corrigió la fecha y hora de la última verificación para host/servicios en la línea de tiempo de la vista Monitor de Host.</li><li>Eliminada información de registro para CPE de ethernet.</li><li>Corregida la búsqueda por defecto en la vista Smart Tree.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>Se solucionó el problema en la vista de información de la pestaña Servicio de host.Cuando intente acceder al servicio actual cuando aún no ha sido cargado.</li><li>Optimizado el modo responsivo del widget resumen</li><li>Se agregó un valor preestablecido predeterminado al rango de fecha y hora en todas las vistas.</li><li>Se agregó la fecha de vencimiento a la vista de la pestaña del monitor del host.</li><li>Se eliminó el número de host de subdominio para evitar cambios en DNS/ACL para obtener direcciones IP de host.</li></ul><h3 id="krill-rubik-ui-2" tabindex="-1"><a class="header-anchor" href="#krill-rubik-ui-2" aria-hidden="true">#</a> Krill Rubik UI</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Añadido el ID administrativo en la vista Edicción de Ticket</li></ul><h3 id="krill-isp-ui-4" tabindex="-1"><a class="header-anchor" href="#krill-isp-ui-4" aria-hidden="true">#</a> Krill ISP UI</h3><p><strong>Algunas correciones</strong>:</p><ul><li>Corregidas algunas traducciones.</li></ul><h3 id="kiwi-3" tabindex="-1"><a class="header-anchor" href="#kiwi-3" aria-hidden="true">#</a> Kiwi</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Creada la aplicación para PBX.</li></ul><h3 id="krill-webservice-api-4" tabindex="-1"><a class="header-anchor" href="#krill-webservice-api-4" aria-hidden="true">#</a> Krill WebService (API)</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Creados nuevos endpoints tipo REST.</li><li>Cuando se da de alta un CPE, el campo modelo aparezca en blanco igual que la velocidad.</li></ul><p><strong>Algunas correciones</strong>:</p><ul><li>El endpoint para PTP no devolvía el servicio ITFS.</li><li>Corregido el aumento considerable del load average provocado por Krill-ws.</li></ul><h3 id="krill-wimax-2" tabindex="-1"><a class="header-anchor" href="#krill-wimax-2" aria-hidden="true">#</a> Krill WiMAX</h3><p><strong>Algunas mejoras</strong>:</p><ul><li>Wimax ahora puede publicar el mapa de registro de los CPE/AP</li></ul>',248),s=[o];function d(n,t){return a(),i("div",null,s)}const u=e(r,[["render",d],["__file","changelog.html.vue"]]);export{u as default};
